/*Table structure for table `sys_permission` */

DROP TABLE IF EXISTS `sys_permission`;

CREATE TABLE `sys_permission` (
  `id` int NOT NULL AUTO_INCREMENT,
  `parent_id` int DEFAULT NULL COMMENT '父权限id',
  `pname` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '权限名称 用户管理',
  `url` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '权限对应的页面访问路径 pages/basic/userInfo.html',
  `CODE` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '权限编码 user:delete',
  `LEVEL` int NOT NULL COMMENT '权限级别',
  `sort` int NOT NULL COMMENT '权限排序等级',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

