/*Table structure for table `sys_role` */

DROP TABLE IF EXISTS `sys_role`;

CREATE TABLE `sys_role` (
  `id` int NOT NULL AUTO_INCREMENT,
  `role_name` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '楼栋管理员',
  `role_code` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ROLE_BUILDING',
  `DESCRIPTION` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '管理楼宇',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted` int DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

